(ns ggplotly-cont
  (:require [tablecloth.api :as tc]
            [scicloj.metamorph.ml.toydata.ggplot :as toydata.ggplot]
            [scicloj.kindly.v4.kind :as kind]))

(defn factor [column]
  (vary-meta column
             assoc :gg/factor? true))

(defn factor? [column]
  (:gg/factor? column))


;; The following template was generated from the JSON file
;; in the HTML generated by
;; `ggplotly(ggplot(mpg, aes(x=hwy, y=displ, color=factor(cyl))) + geom_point() + geom_smooth(method="lm"))`


(defn marker [color]
  {:autocolorscale false,
   :color color,
   :opacity 1,
   :size 5.66929133858268,
   :symbol "circle",
   :line {:width 1.88976377952756, :color color}})

(defn point-layer [{:keys [x y color text name legendgroup]}]
  {:hoveron "points",
   :legendgroup legendgroup,
   :frame nil,
   :hoverinfo "text",
   :name name,
   :marker (marker color)
   :mode "markers",
   :type "scatter",
   :xaxis "x",
   :yaxis "y",
   :showlegend true,
   :x (vec x)
   :y (vec y)
   :text (vec text)})

(def colors
  ["rgba(248,118,109,1)"
   "rgba(124,174,0,1)"
   "rgba(0,191,196,1)"
   "rgba(199,124,255,1)"])

(def config
  {:doubleClick "reset",
   :modeBarButtonsToAdd ["hoverclosest" "hovercompare"],
   :showSendToCloud false},)

(def highlight
  {:on "plotly_click",
   :persistent false,
   :dynamic false,
   :selectize false,
   :opacityDim 0.2,
   :selected {:opacity 1},
   :debounce 0},)

